INSERT INTO email_template VALUES ('1','<p>\r\n	Hi ${<span data-scayt_word=`accountName` data-scaytid=`1`>accountName</span>}</p>\r\n<p>\r\n	Welcome to STARBOARD <span data-scayt_word=`B2B` data-scaytid=`2`>B2B</span> Web site. Please keep this e-mail for your records. Your account information is as follows:</p>\r\n<p>\r\n	-------------------------------</p>\r\n<p>\r\n	URL: ${<span data-scayt_word=`serverPath` data-scaytid=`9`>serverPath</span>}<br />\r\n	Username : ${username}<br />\r\n	Password : ${password}</p>\r\n<p>\r\n	------------------------------<br />\r\n	<br />\r\n	Please visit the following link in order to activate your account:<br />\r\n	${<span data-scayt_word=`serverName` data-scaytid=`4`>serverName</span>}/BakCustAction.do?method=<span data-scayt_word=`activateUser` data-scaytid=`6`>activateUser</span>&amp;<span data-scayt_word=`custUserId` data-scaytid=`7`>custUserId</span>=${username}&amp;k=${<span data-scayt_word=`encryptKey` data-scaytid=`8`>encryptKey</span>}</p>\r\n<p>\r\n	Your password has been securely stored in our database and cannot be retrieved. In the event that it is forgotten, you will be able to reset it using the email address associated with your account. Thank you for registering.</p>\r\n<p>\r\n	- The STARBOARD team</p>\r\n','Account Activation','2015-01-22 09:08:47','2015-01-22 09:08:47','null','null');
INSERT INTO email_template VALUES ('2','<p>\r\n	Hi starboard team,</p>\r\n<p>\r\n	We request to change the company address as the following information:</p>\r\n<p>\r\n	Customer Code: ${address.custId}<br />\r\n	CustomerName: ${cust.nameEn}</p>\r\n<p>\r\n	Address Type : #if ($address.type == `1` ) Company Address #else Shipping Address #end<br />\r\n	Address : ${address.address}<br />\r\n	Country : ${address.regionCountryId}<br />\r\n	Post Code: ${address.postCode}<br />\r\n	Tel : ${address.tel1}<br />\r\n	Fax: ${address.fax}<br />\r\n	Email: ${address.email}</p>\r\n<p>\r\n	Sincerely,</p>\r\n<p>\r\n	${custUser.name}<br />\r\n	${cust.nameEn}</p>\r\n','Request for changing address information','2015-01-22 09:08:47','2015-01-22 09:08:47',NULL,NULL);
INSERT INTO email_template VALUES ('10','<p>\r\n	Dear sir,</p>\r\n<p>\r\n	<span style=`font-size: 12px;`>Thank you for your order number ${order.orderCode}</span></p>\r\n<p>\r\n	<br />\r\n	Best Regards,</p>\r\n<p>\r\n	Starboard team</p>\r\n','Order Acknowledgement ${order.orderCode} - Wait for approve','2015-01-22 09:08:47','2015-01-22 09:08:47',NULL,NULL);
INSERT INTO email_template VALUES ('20','<p>\r 	Dear Sir/Madam<br />\r 	<br />\r 	We are pleased to inform you that the order ${order.orderCode} need to be revised. Please see the details of the detail in the STARBOARD <span data-scayt_word=`B2B` data-scaytid=`1`>B2B</span> System.</p>\r <p>\r 	${serverPath}<br />\r 	<br />\r 	- The STARBOARD team</p>\r ','Order Acknowledgement ${order.orderCode} - Revised','2015-01-22 09:08:47','2015-01-22 09:08:47',NULL,NULL);
INSERT INTO email_template VALUES ('30','<p>\r\n	Dear sir,<span style=`font-size: 12px;`>&nbsp; &nbsp; &nbsp; &nbsp; </span></p>\r\n<p>\r\n	<span style=`font-size: 12px;`>Thank you for your Request Order.</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	This is an auto reply to confirm that your Request Order&nbsp;${order.orderCode} had been successfully submitted. Until your Request Order status changed to &quot;APPROVED&quot; this Request Order hasn&#39;t yet active in production.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Please do not hesitate to send mail to our Sale Coordinator if you do not receive any order confirmation from us within 2 working days.</p>\r\n<p>\r\n	<br />\r\n	<br />\r\n	Best Regards,</p>\r\n<p>\r\n	Starboard team</p>\r\n','Order Acknowledgement ${order.orderCode} - Approved','2015-01-22 09:08:47','2015-01-22 09:08:47',NULL,NULL);
INSERT INTO email_template VALUES ('40','<p>\r 	Dear ${custUser.name}<br />\r 	<br />\r 	We are pleased to inform you that one or more of your items is on production process. Please see the details of the detail in the STARBOARD B2B System.</p>\r <p>\r 	${serverPath}</p>\r <p>\r 	<br />\r 	- The STARBOARD team</p>\r ','Order Acknowledgement ${order.orderCode} - On Production','2015-01-22 09:08:47','2015-01-22 09:08:47',NULL,NULL);
INSERT INTO email_template VALUES ('50','<p>\r 	Dear ${custUser.name}<br />\r 	<br />\r 	We are pleased to inform you that one or more of your items of order ${order.orderCode} is ready to ship. Please see the details of the detail in the STARBOARD B2B System.</p>\r <p>\r 	${serverPath}<br />\r 	<br />\r 	- The STARBOARD team</p>\r ','Order Acknowledgement ${order.orderCode} - Ready to Ship','2015-01-22 09:08:47','2015-01-22 09:08:47',NULL,NULL);
